import React, { useState } from 'react';
import Nav from './Nav';
import useFetchUser from './useFetchUser';
import { useNavigate } from 'react-router-dom';

function MyPage() {
    const { user } = useFetchUser();
    const navigation = useNavigate();

    return (
        <div>
            <div>
                <Nav user={user} />
            </div>
            <div>
                <div>
                    <h4>내가 작성한 게시글</h4>
                </div>

                <div>
                    <h4>내가 작성한 댓글</h4>
                </div>

                <div>
                    <h4>내가 작성한 게시글</h4>
                </div>
            </div>
        </div>
    );
}

export default MyPage;
